// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./Government.sol";

abstract contract PartiesFactory is Government{

    ////////////////////////////////////////////////////////////
    // EVENTS //////////////////////////////////////////////////
    ////////////////////////////////////////////////////////////

    event PartyCreated(uint indexed id, string name, string symbol, address leader);

    event PartyRegisteredForElection(string name, string symbol, address leader);

    ////////////////////////////////////////////////////////////
    // Structs /////////////////////////////////////////////////
    ////////////////////////////////////////////////////////////

    struct Party{
        uint creationTime;
        string name;
        string symbol;
        address leader;
        address[] members;
        bool active;
        address[] supporters;
        bool registered;
    }

    ////////////////////////////////////////////////////////////
    // Variables ///////////////////////////////////////////////
    ////////////////////////////////////////////////////////////

    uint[] internal partyIDs;
    Party[] internal parties;
    uint public partiesCount;
    uint internal partiesRegisteredCount;

    ////////////////////////////////////////////////////////////
    // Mappings ////////////////////////////////////////////////
    ////////////////////////////////////////////////////////////

    mapping(uint => Party) public idToParty;
    mapping(address => uint) internal addressToPartyID;
    mapping(address => uint) internal partiesForAddress;

    ////////////////////////////////////////////////////////////
    // Constructor /////////////////////////////////////////////
    ////////////////////////////////////////////////////////////

    // constructor(){

    // }


    ////////////////////////////////////////////////////////////
    // Modifiers ///////////////////////////////////////////////
    ////////////////////////////////////////////////////////////

    modifier onlyLeader(){
        uint partyID = addressToPartyID[_msgSender()];
        require(parties[partyID].leader == _msgSender());
        _;
    }

    modifier _partyExists(uint partyId){
        require(partyId < parties.length, "Party does not exist");
        _;
    }

    ////////////////////////////////////////////////////////////
    // Party functions /////////////////////////////////////////
    ////////////////////////////////////////////////////////////

    function _createParty(string memory _name, string memory _symbol, address _leader) private{
        Party memory newParty;
        newParty.creationTime = block.timestamp;
        newParty.name = _name;
        newParty.symbol = _symbol;
        newParty.leader = _leader;
        newParty.members = new address[](0);
        newParty.supporters = new address[](0);
        newParty.active = true;

        parties.push(newParty);

        idToParty[parties.length - 1] = newParty;
        addressToPartyID[_leader] = parties.length - 1;
        partiesForAddress[_leader]++;
        partiesCount++;
        emit PartyCreated(parties.length - 1, _name, _symbol, _leader);
    }

    function createParty(string memory name, string memory symbol) external payable{
        require(partiesForAddress[_msgSender()] == 0, "You already own a party");
        require(msg.value == 1 ether);
        require(bytes(name).length > 0 && bytes(symbol).length > 0);
        _createParty(name, symbol, _msgSender());
    }

    function changePartyStatus(bool status) external onlyLeader{
        uint partyId = addressToPartyID[_msgSender()];
        require(idToParty[partyId].active != status, "Party already has this status");       
        idToParty[partyId].active = status;
    }

    function deleteParty() external onlyLeader{
        uint partyId = addressToPartyID[_msgSender()];
        for (uint i = 0; i < parties.length; i++){
            if (partyIDs[i] == partyId){
                parties.pop();
                partyIDs.pop();
                break;
            }
        }
    }

    function addMemberToParty(address member) external onlyLeader{
        require(partiesForAddress[member] == 0, "Member already belongs to a party");
        uint partyId = addressToPartyID[_msgSender()];
        idToParty[partyId].members.push(member);
        addressToPartyID[member] = partyId;
        partiesForAddress[member]++;
    }

    function addSupporter(uint partyId) external _partyExists(partyId) {
        require(partiesForAddress[_msgSender()] == 0, "Supporter already belongs to a party");
        idToParty[partyId].supporters.push(_msgSender());
        addressToPartyID[_msgSender()] = partyId;
        partiesForAddress[_msgSender()]++;
    }

    function getPartyFromAddress() external view returns (Party memory){
        require(partiesForAddress[_msgSender()] > 0, "You do not belong to a party");
        uint partyId = addressToPartyID[_msgSender()];
        return idToParty[partyId];
    }

    function getParty(uint index) external view returns (Party memory){
        return idToParty[index];
    }
}
